import React, { Component } from "react"
import ComedianProfile from "../Components/ComedianProfile"

function ComediansContainer (props) {
    console.log(props.api)
    const renderComedians = props.api.map(comic => <ComedianProfile key={comic.id} name={comic.name} website={comic.personal_website} headshot={comic.headshot} city={comic.city}/> )
    return(
        <>
            <h1>Comedians Container</h1>
            {renderComedians}
        </>

    )
}

export default ComediansContainer
